import React from 'react';

// import { Container } from './styles';

export default function Grid(props) {
  const { value } = props;
  const couriers = value[0];
  console.tron.log('Grid', value);
  return (
    <>
      <Table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Foto</th>
            <th>E-mail</th>
          </tr>
        </thead>
        <tbody>
          {couriers.map(c => (
            <tr key={c.id}>
              <td>{c.id}</td>
              <td>
                <img
                  src="https://api.adorable.io/avatars/50/abott@adorable.png"
                  alt=""
                />
              </td>
              <td>{c.name}</td>
              <td>{c.email}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </>
  );
}
